import React from "react";
import {
  Cabecalho,
  Botao, SeparadorDiv, SeparadorDivDois, LogoMarca, } from "./estiloHome";

function Home() {
  return (
    <div>
      <header>
        <Cabecalho>
          <SeparadorDiv></SeparadorDiv>
          <LogoMarca
            img
            src={require("../imagens/target-Music.png")}
          ></LogoMarca>
          <SeparadorDivDois></SeparadorDivDois>
          <Botao>Sobre </Botao>
          <SeparadorDiv></SeparadorDiv>
          <Botao>Contato</Botao>
          <SeparadorDiv></SeparadorDiv>
          <Botao>Admin</Botao>
          <SeparadorDiv></SeparadorDiv>
        </Cabecalho>
      </header>
      <body></body>
    </div>
  );
}

export default Home;
